                MissionData.vTarget_01 = MissionData.MyMissions.FubardXM[MissionData.iTestKit].FUbarPed;//Ped Spawn

                MissionData.iTestKit += 1;

                ReturnStuff.Fubar_Vectors(MissionData.iLocationX, iFubPick, false, false);
                int iBe = ReturnStuff.RandInt(0, MissionData.VectorList_01.Count - 1);
                MissionData.vTarget_03 = MissionData.VectorList_01[iBe];
            }
            else
            {
                if (iFubPick == 0)
                    iFubPick = ReturnStuff.Fubar_Vectors(MissionData.iLocationX, iFubPick, true, true);
                else
                    iFubPick = ReturnStuff.Fubar_Vectors(MissionData.iLocationX, iFubPick, false, true);

                int iRandomPicks = iRandomPicks = ReturnStuff.RandInt(0, MissionData.VectorList_01.Count - 1);

                MissionData.vTarget_02 = MissionData.VectorList_01[iRandomPicks];//Park Here
                while (MissionData.vGetaway.DistanceTo(MissionData.vTarget_02) < 2.00f)
                {
                    iRandomPicks = iRandomPicks = ReturnStuff.RandInt(0, MissionData.VectorList_01.Count - 1);
                    MissionData.vTarget_02 = MissionData.VectorList_01[iRandomPicks];//Park Here
                }
                MissionData.vTarget_01 = MissionData.VectorList_02[iRandomPicks];//Ped Spawn

                int iRanDest = ReturnStuff.FindRandom(4, 0, 50);
                if (iRanDest < 20)
                {
                    int YourDest = ReturnStuff.RandInt(0, MissionData.VectorList_01.Count - 1);
                    MissionData.vTarget_03 = MissionData.VectorList_01[YourDest];
                    while (MissionData.vTarget_02.DistanceTo(MissionData.vTarget_03) < 30.00f)
                    {
                        YourDest = ReturnStuff.RandInt(0, MissionData.VectorList_01.Count - 1);
                        MissionData.vTarget_03 = MissionData.VectorList_01[YourDest];
                    }
                }
                else if (iRanDest < 35)
                {
                    int iZoneOut = iFubPick;

                    while (iZoneOut == iFubPick)
                        iZoneOut = ReturnStuff.Fubar_Vectors(MissionData.iLocationX, 0, true, false);

                    int iBe = ReturnStuff.RandInt(0, MissionData.VectorList_01.Count - 1);

                    MissionData.vTarget_03 = MissionData.VectorList_01[iBe];
                }
                else if (iRanDest < 49)
                {
                    int iPickDiff = MissionData.iLocationX;

                    if (iPickDiff > 1 && iPickDiff < 6)
                    {
                        if (ReturnStuff.FindRandom(80, 1, 4) > 2)
                            iPickDiff += 1;
                        else
                            iPickDiff -= 1;
                    }
                    else if (iPickDiff == 1)
                        iPickDiff = 2;
                    else
                        iPickDiff = 5;

                    ReturnStuff.Fubar_Vectors(iPickDiff, 0, true, false);

                    int iBe = ReturnStuff.RandInt(0, MissionData.VectorList_01.Count - 1);

                    MissionData.vTarget_03 = MissionData.VectorList_01[iBe];
                }
                else
                {
                    MissionData.vTarget_03 = new Vector3(-1033.683f, -2722.559f, 12.99118f);
                }
            }

            int iPass = ReturnStuff.FindRandom(100, 1, 15);
            if (iPass < 10)
                iPass = 2;
            else if (iPass < 13)
                iPass = 1;
            else
                iPass = 3;

            MissionData.vTarget_02 = ReturnStuff.AlterZHight(MissionData.vTarget_02, -1.00f);
            MissionData.vTarget_03 = ReturnStuff.AlterZHight(MissionData.vTarget_03, -1.00f);

            MissionData.vGetaway = MissionData.vTarget_03;

            MissionData.iList_01.Add(0);//iToteTaxi  0
            MissionData.iList_01.Add(0);//iDeadTaxi  1
            MissionData.iList_01.Add(0);//MissionData.iAngerTax  2
            MissionData.iList_01.Add(iPass);//iFUberPass  3
            MissionData.iList_01.Add(0);//iStupidPed 4

            MissionData.BeOnOff.Add(false);//bTruckBlip 0
            MissionData.BeOnOff.Add(false);//bMoveYourV 1
            MissionData.BeOnOff.Add(false);//bVAComplete2
            MissionData.BeOnOff.Add(false);//bRadioPlay 3
