            {
                UiDisplay.MpUiDisplay.Add(UiDisplay.ttTextBar_01);
                UiDisplay.ttTextBar_01.Label = "" + DataStore.MyLang.Othertext[4] + "";
                if (!MissionData.bTestRun)
                    BigMessageThread.MessageInstance.ShowSimpleShard(DataStore.MyLang.Jobtext[4], "", 5000);

