        public static void Trucking_Attachments(int iAtt)
        {
            LoggerLight.LogThis("Trucking_Attachments");

            if (iAtt == 1)
                Function.Call(Hash.ATTACH_VEHICLE_TO_TRAILER, MissionData.VehTrackin_01.Handle, MissionData.VehTrackin_02.Handle, 5.0f);
            else if (iAtt == 2)
                ObjectBuild.VehicleSpawn("Tropic2", MissionData.VehTrackin_02.Position, MissionData.VehTrackin_02.Heading, true, false, false, false, 16, 1, 0, "", 0, false);
            else if (iAtt == 3)
                ObjectBuild.VehicleSpawn("Bulldozer", MissionData.VehTrackin_02.Position, MissionData.VehTrackin_02.Heading, true, false, false, false, 16, 2, 0, "", 0, false);
            else if (iAtt == 4)
                ObjectBuild.VehicleSpawn("Lguard", MissionData.VehTrackin_02.Position, MissionData.VehTrackin_02.Heading, true, false, false, false, 16, 2, 0, "", 0, false);
            else if (iAtt == 5)
                ObjectBuild.VehicleSpawn("RHINO", MissionData.VehTrackin_02.Position, MissionData.VehTrackin_02.Heading, true, false, false, false, 16, 3, 0, "", 0, false);
            else if (iAtt == 6)
                ObjectBuild.VehicleSpawn("SUBMERSIBLE2", MissionData.VehTrackin_02.Position, MissionData.VehTrackin_02.Heading, true, false, false, false, 16, 5, 0, "", 0, false);
            else if (iAtt == 7)
            {
                List<int> MyExtras = new List<int>();
                Vehicle Buzz = ObjectBuild.VehicleSpawn("Buzzard", MissionData.VehTrackin_02.Position, MissionData.VehTrackin_02.Heading, true, false, false, false, 16, 3, 0, "", 0, false);
