        public static void Trucking_CashNCrash()
        {
            LoggerLight.LogThis("Trucking_CashNCrash");

            MissionData.Crash4s = new Crash4Cash();

            float fVehCheck = MissionData.VehTrackin_01.BodyHealth + MissionData.VehTrackin_01.EngineHealth + MissionData.VehTrackin_01.PetrolTankHealth;
            MissionData.Crash4s.VehXHealth.Add((int)fVehCheck);
            MissionData.Crash4s.VehX.Add(new Vehicle(MissionData.VehTrackin_01.Handle));
            fVehCheck = MissionData.VehTrackin_02.BodyHealth + MissionData.VehTrackin_02.EngineHealth + MissionData.VehTrackin_02.PetrolTankHealth;
            MissionData.Crash4s.VehXHealth.Add((int)fVehCheck);
            MissionData.Crash4s.VehX.Add(new Vehicle(MissionData.VehTrackin_02.Handle));

            float fdist = Vector3.Distance2D(MissionData.VehTrackin_02.Position, MissionData.vTarget_01);
            int icash = (int)fdist;
            icash = icash / 10;
            MissionData.iCrash4Cash = icash * 50;
            if (MissionData.BeOnOff[5])
                MissionData.iCrash4Cash = MissionData.iCrash4Cash / 2;
            MissionData.iCashReward = MissionData.iCrash4Cash;
        }
