            MissionData.iCashReward = MissionData.iMissionVar_03;

            ObjectBuild.VehicleSpawn(MissionData.sVehType, MissionData.vGetaway, MissionData.fMission_01, true, true, false, false, 0, 0, 0, "", 1, false);

            Function.Call(Hash.TASK_SET_BLOCKING_OF_NON_TEMPORARY_EVENTS, MissionData.Npc_01.Handle, false);
            Function.Call(Hash.TASK_SET_BLOCKING_OF_NON_TEMPORARY_EVENTS, MissionData.Npc_02.Handle, false);
            Function.Call(Hash.TASK_SET_BLOCKING_OF_NON_TEMPORARY_EVENTS, MissionData.Npc_03.Handle, false);

            ObjectBuild.ArmsRegulator(MissionData.Npc_01, 3);
