            ObjectBuild.ArmsRegulator(MissionData.Npc_03, 3);

            MissionData.BeOnOff[7] = true;

            if (!MissionData.BeOnOff[0])
                ObjectHand.NSCoinInvestments(false, 25, 50, "Fleeca Shares");
        }
