        public static void Getaway_CarSwap(Vehicle Vhick)
        {
            LoggerLight.LogThis("Getaway_CarSwap");

            Vehicle Vreplace = World.CreateVehicle(Vhick.Model, new Vector3(1563.228f, 3793.665f, 33.65359f));
            Vreplace.IsPersistent = true;
            MissionData.VehicleList_01.Add(new Vehicle(Vreplace.Handle));
            Function.Call(Hash.SET_VEHICLE_MOD_KIT, Vreplace.Handle, 0);
            if (Vhick.IsToggleModOn(VehicleToggleMod.Turbo))
                Vreplace.ToggleMod(VehicleToggleMod.Turbo, true);
            if (Vhick.IsToggleModOn(VehicleToggleMod.XenonHeadlights))
                Vreplace.ToggleMod(VehicleToggleMod.XenonHeadlights, true);
            for (int i = 0; i < 67; i++)
            {
                int imoded = Function.Call<int>(Hash.GET_VEHICLE_MOD, Vhick.Handle, i);
                Function.Call(Hash.SET_VEHICLE_MOD, Vreplace.Handle, i, imoded, true);
            }
            Vector3 VeVecP = Vhick.Position;
            Vector3 VeVecO = Vhick.Rotation;
            Vhick.Delete();
            ObjectBuild.VehicleWarp(Vreplace, Game.Player.Character, 1);
            Vreplace.Position = VeVecP;
            Vreplace.Rotation = VeVecO;
            MissionData.VehTrackin_05 = Vreplace;
            MissionData.iMissionSeq = 3;
            ObjectHand.RemoveTargets();
            World.AddExplosion(MissionData.vTarget_03, ExplosionType.Flare, 1.0f, 0.0f);
            ObjectBuild.EnterAnyVeh(MissionData.VehTrackin_05, MissionData.Npc_01, 1, 2.00f);
            ObjectBuild.EnterAnyVeh(MissionData.VehTrackin_05, MissionData.Npc_02, 2, 2.00f);
            ObjectBuild.EnterAnyVeh(MissionData.VehTrackin_05, MissionData.Npc_03, 3, 2.00f);
            MissionData.iWait4Sec = Game.GameTime + 15000;
            MissionData.VehTrackin_05.EngineRunning = false;
            MissionData.VehTrackin_05.IsExplosionProof = false;
            MissionData.VehTrackin_05.IsOnlyDamagedByPlayer = false;
            MissionData.VehTrackin_05.IsFireProof = false;
            MissionData.BeOnOff[7] = true;
        }
        public static void Packages_DeliverThis(List<Vector3> MyDrops, int iDropIt, bool bUseAll)
        {
            LoggerLight.LogThis("Packages_DeliverThis, iDropIt == " + iDropIt);

            MissionData.VectorList_01.Clear();

            if (bUseAll)
                MissionData.VectorList_01 = MyDrops;
            else
            {
                List<int> DropSelect = new List<int>();
                List<Vector3> DropVec = new List<Vector3>();
                int iRanRange = MyDrops.Count - 1;
                while (iDropIt > 0)
                {
                    int iRan = ReturnStuff.RandInt(0, iRanRange);
                    if (DropSelect.Count == 0)
                    {
                        DropSelect.Add(iRan);
                        iDropIt = iDropIt - 1;
                    }
                    else
                    {
                        if (!DropSelect.Contains(iRan))
                        {
                            DropSelect.Add(iRan);
                            iDropIt = iDropIt - 1;
                        }
                    }
                }
                for (int i = 0; i < DropSelect.Count; i++)
                    DropVec.Add(MyDrops[DropSelect[i]]);

                MissionData.VectorList_01 = ReturnStuff.ListReverseVec3(ReturnStuff.FarToNear(DropVec, MissionData.vTarget_05));
            }

            float fTotalDist = MissionData.VectorList_01[MissionData.VectorList_01.Count - 1].DistanceTo(MissionData.vTarget_05);
            float fRoadDist = World.CalculateTravelDistance(MissionData.VectorList_01[MissionData.VectorList_01.Count - 1], MissionData.vTarget_05);

            LoggerLight.LogThis("Packages_DeliverThis, fTotalDist == " + fTotalDist + ", fRoadDist == " + fRoadDist);

            for (int i = MissionData.VectorList_01.Count - 1; i > 0; i--)
            {
                float fDist = MissionData.VectorList_01[i].DistanceTo(MissionData.VectorList_01[i - 1]);
                fTotalDist += fDist;
            }
            LoggerLight.LogThis("Packages_DeliverThis, iTotalDist == " + fTotalDist);

            MissionData.iTime_01[0] = (int)fTotalDist * 75;
            fTotalDist *= 2;
            if (fTotalDist < fRoadDist)
                MissionData.iTime_01[0] *= 2;
        }
