        public static void Convicts_WalkLoop()
        {
            int iBeenHit = 0;
            for (int i = 0; i < MissionData.PedList_01.Count; i++)
            {
                if (MissionData.PedList_01[i].HasBeenDamagedBy(Game.Player.Character))
                    iBeenHit += 1;
                else if (MissionData.PedList_01[i].IsFleeing)
                    iBeenHit += 1;
                else if (MissionData.PedList_01[i].Position.DistanceTo(MissionData.VectorList_01[MissionData.iList_01[i]]) < 1.50f)
                    MissionData.iList_01[i] = ReturnStuff.PedWalkies(MissionData.PedList_01[i], MissionData.VectorList_01, MissionData.iList_01[i]);
            }

            if (iBeenHit > 0)
            {
                iBeenHit = 0;
                if (MissionData.BeOff[0])
                {
                    MissionData.BeOff[0] = false;
                    DataStore.Hare.Stop();
                }

                Script.Wait(2000);
                for (int i = 0; i < MissionData.PedList_01.Count; i++)
                {
                    if (MissionData.PedList_01[i].HasBeenDamagedBy(Game.Player.Character))
                        iBeenHit += 1;
                    else if (MissionData.PedList_01[i].IsDead)
                        iBeenHit += 1;

                    MissionData.PedList_01[i].Task.FleeFrom(Game.Player.Character);
                }
                if (iBeenHit == MissionData.PedList_01.Count)
                    MissionData.iMissionSeq = 25;
                else
                    MissionData.iMissionSeq = 45;
            }
            else
                MissionData.BeOff[3] = false;
        }
