        public static void Racist_StartLine()
        {
            LoggerLight.LogThis("Racist_StartLine");

            Function.Call(Hash.SET_VEHICLE_POPULATION_BUDGET, 0);
            Function.Call(Hash.SET_PED_POPULATION_BUDGET, 0);
            Function.Call(Hash.SET_FAR_DRAW_VEHICLES, false);

            bool bBoata = false;
            MissionData.VehTrackin_01.CurrentBlip.Remove();
            MissionData.VehTrackin_01 = Game.Player.Character.CurrentVehicle;
            if (!MissionData.VehTrackin_01.IsPersistent)
            {
                MissionData.VehTrackin_01.IsPersistent = true;
                MissionData.bIsVehPers = true;
            }
            MissionData.VehTrackin_01.FreezePosition = true;
            Game.FadeScreenOut(1000);
            Script.Wait(1000);
            MissionData.VehTrackin_01.Position = MissionData.MyMissions.RaceXM[MissionData.iMissionVar_01].RaceCars[3];
            MissionData.VehTrackin_01.Heading = MissionData.MyMissions.RaceXM[MissionData.iMissionVar_01].RaceHead[3];

            if (MissionData.iList_01[0] == 2 || MissionData.iList_01[0] == 6)
            {
                MissionData.VehTrackin_01.FreezePosition = false;
                MissionData.VehTrackin_01.IsDriveable = false;
                Function.Call(Hash.SET_BOAT_ANCHOR, MissionData.VehTrackin_01.Handle, true);
                bBoata = true;
            }

            if (!MissionData.bSoloRace)
            {
                if (MissionData.sMissionVar_01 == "" || Game.Player.Character.CurrentVehicle.Model.Hash != Function.Call<int>(Hash.GET_HASH_KEY, MissionData.sMissionVar_01))
                    MissionData.sMissionVar_01 = "GetPlayersVeh";

                ObjectBuild.VehicleSpawn(MissionData.sMissionVar_01, MissionData.MyMissions.RaceXM[MissionData.iMissionVar_01].RaceCars[1], MissionData.MyMissions.RaceXM[MissionData.iMissionVar_01].RaceHead[1], false, MissionData.BeOnOff[0], false, false, 22, 0, -1, "", 2, true);
                ObjectBuild.VehicleSpawn(MissionData.sMissionVar_01, MissionData.MyMissions.RaceXM[MissionData.iMissionVar_01].RaceCars[2], MissionData.MyMissions.RaceXM[MissionData.iMissionVar_01].RaceHead[2], false, MissionData.BeOnOff[0], false, false, 22, 0, -1, "", 3, true);
                ObjectBuild.VehicleSpawn(MissionData.sMissionVar_01, MissionData.MyMissions.RaceXM[MissionData.iMissionVar_01].RaceCars[4], MissionData.MyMissions.RaceXM[MissionData.iMissionVar_01].RaceHead[4], false, MissionData.BeOnOff[0], false, false, 22, 0, -1, "", 4, true);
            }

            Game.FadeScreenIn(1000);
            Function.Call(Hash.PLAY_SOUND_FRONTEND, -1, "NET_RACE_START_EVENT_MASTER", 0, true);

            Function.Call(Hash.DISPLAY_RADAR, false);

            Vector3 Campo = MissionData.VehTrackin_01.Position + (MissionData.VehTrackin_01.ForwardVector * 4.00f) + (MissionData.VehTrackin_01.UpVector * 1.50f);

            if (bBoata)
                Campo = MissionData.VehTrackin_01.Position + (MissionData.VehTrackin_01.ForwardVector * 14.00f) + (MissionData.VehTrackin_01.UpVector * 3.00f);

            Vector3 Camro = new Vector3(0.00f, 0.00f, MissionData.VehTrackin_01.Heading - 180.00f);

            MissionData.cCams = World.CreateCamera(Campo, Camro, 50.00f);
            Function.Call(Hash.RENDER_SCRIPT_CAMS, 1, 1, MissionData.cCams.Handle, 0, 0);
            Script.Wait(8000);

            ObjectHand.CleanCams();
            ObjectHand.RemoveTargets();
            ObjectHand.CleanUpBlips(ObjectHand.ConvertToHandle(MissionData.BlipList_01, null, null, null), true);
            MissionData.BlipList_01.Clear();
            MissionData.fMaxSpeed = Function.Call<float>(Hash._GET_VEHICLE_MAX_SPEED, MissionData.VehTrackin_01.Model);
        }
        public static void Racist_CountDown(Vector3 Vpos, bool bAddBeeps)
        {
            LoggerLight.LogThis("Racist_CountDown");

            int iTimes = Game.GameTime + 1000;
            int iPlayFor = ReturnStuff.RandInt(500, 900);
            int iRaceCount = 5;
            UiDisplay.MMDisplay01 = new MarkyMark { MarkType = MarkerType.Number5, MarkPos = new Vector3(Vpos.X, Vpos.Y, Vpos.Z + 1.00f), MarkDir = Vector3.Zero, MarkRot = new Vector3(0.00f, 0.00f, Game.Player.Character.Heading), MarkScale = new Vector3(MissionData.fCorSize, MissionData.fCorSize, MissionData.fCorSize), MarkCol = Color.IndianRed };
            UiDisplay.bMMDisplay01 = true;

            while (iRaceCount > 0)
            {
                if (iTimes < Game.GameTime)
                {
                    iTimes = Game.GameTime + 1000;
                    if (iRaceCount == 5)
                        UiDisplay.MMDisplay01.MarkType = MarkerType.Number4;
