                            MissionData.MultiPed[i].MyTarget_01 = MissionData.MyMissions.RaceXM[MissionData.iMissionVar_01].TheRace[MissionData.MultiPed[i].MyTask_01];
                            Raceisums(MissionData.MultiPed[i].MyPed, MissionData.MultiPed[i].MyTarget_01, MissionData.MultiPed[i].MyVehicle, MissionData.fMaxSpeed);
                        }
                    }
                }
            }
            else
            {
                for (int i = 0; i < MissionData.MultiPed.Count; i++)
                {
                    if (MissionData.MultiPed[i].MyTask_02 < MissionData.iList_01[3])
                        iRaceRiot = iRaceRiot - 1;
                    else if (MissionData.MultiPed[i].MyTask_01 < MissionData.iList_01[6])
                        iRaceRiot = iRaceRiot - 1;
                    else if (MissionData.MultiPed[i].MyTask_01 == MissionData.iList_01[6])
                    {
                        if (Game.Player.Character.Position.DistanceTo(MissionData.vTarget_01) < MissionData.MultiPed[i].MyPed.Position.DistanceTo(MissionData.vTarget_01))
                            iRaceRiot = iRaceRiot - 1;
                    }

                    if (MissionData.MultiPed[i].MyPed.IsDead)
                    {

                    }
                    else if (!MissionData.MultiPed[i].MyPed.IsInVehicle())
                    {
                        Racist_BackOnTrack(MissionData.MultiPed[i].MyPed, MissionData.MultiPed[i].MyVehicle, MissionData.MultiPed[i].MyTarget_02, MissionData.MultiPed[i].MyFloat_01, false, true);
                        Raceisums(MissionData.MultiPed[i].MyPed, MissionData.MultiPed[i].MyTarget_01, MissionData.MultiPed[i].MyVehicle, MissionData.fMaxSpeed);
                    }
                    else
                    {
                        if (MissionData.MultiPed[i].MyVehicle.Position.DistanceTo(MissionData.MultiPed[i].MyTarget_01) < 45.00f)
                        {
                            if (MissionData.MultiPed[i].MySwitch_01)
