                                    if (MissionData.MultiPed[i].MyTask_01 == MissionData.MyMissions.RaceXM[MissionData.iMissionVar_01].TheRace.Count)
                                    {
                                        MissionData.MultiPed[i].MyTask_01 = 0;
                                        MissionData.MultiPed[i].MyTask_02 += 1;
                                    }
                                    MissionData.MultiPed[i].MyTarget_02 = MissionData.MultiPed[i].MyTarget_01;
                                    MissionData.MultiPed[i].MyFloat_01 = MissionData.MultiPed[i].MyVehicle.Heading;
                                    MissionData.MultiPed[i].MyTarget_01 = MissionData.MyMissions.RaceXM[MissionData.iMissionVar_01].TheRace[MissionData.MultiPed[i].MyTask_01];
