        public static void Raceisums(Ped PedX, Vector3 vEctor, Vehicle Vhick, float fSpeeds)
        {
            if (Vhick.ClassType == VehicleClass.Helicopters)
            {
                PedX.Task.ClearAll();
                float fheadder = Function.Call<float>(Hash.GET_HEADING_FROM_VECTOR_2D, PedX.Position.X - vEctor.X, PedX.Position.Y - vEctor.Y - 180.00f);
                ObjectBuild.FlyAway(PedX, vEctor, fSpeeds, 0.00f);
            }
            else if (Vhick.ClassType == VehicleClass.Boats)
            {
                PedX.Task.ClearAll();
                Function.Call(Hash.TASK_BOAT_MISSION, PedX.Handle, Vhick.Handle, 0, 0, vEctor.X, vEctor.Y, vEctor.Z, 4, fSpeeds / 2.00f, MissionData.iRacingStyle, 2.50f, 7);
                Function.Call(Hash.SET_BLOCKING_OF_NON_TEMPORARY_EVENTS, PedX.Handle, true);
            }
            else
                ObjectBuild.DriveToDest(Vhick, vEctor, PedX, fSpeeds, MissionData.iRacingStyle);
        }
        public static void RaceEnd(bool bFail)
        {
            LoggerLight.LogThis("RaceEnd, bFail == " + bFail);
            int iOnLap = MissionData.iTotalLap - MissionData.iCurrentLap;

            if (MissionData.bCutingCul)
            {
                MissionData.bCutingCul = false;
                Function.Call((Hash)0x9BAE5AD2508DF078, false);
            }

            Function.Call(Hash._0xC54A08C85AE4D410, 0.00f);

            if (bFail)
                GameOver(true, "", false, 0);
            else
            {
                int iRaceRiot = 4;
                if (!MissionData.bSoloRace)
                {
                    for (int i = 0; i < MissionData.MultiPed.Count; i++)
                    {
                        if (MissionData.MultiPed[i].MyTask_02 < MissionData.iList_01[3])
                            iRaceRiot = iRaceRiot - 1;
                        else if (MissionData.MultiPed[i].MyTask_01 < MissionData.iList_01[6])
                            iRaceRiot = iRaceRiot - 1;
                        else if (MissionData.MultiPed[i].MyTask_01 == MissionData.iList_01[6])
                        {
                            if (Game.Player.Character.Position.DistanceTo(MissionData.vTarget_01) < MissionData.MultiPed[i].MyPed.Position.DistanceTo(MissionData.vTarget_01))
                                iRaceRiot = iRaceRiot - 1;
                        }
                    }
                    MissionData.iList_01[3] = iRaceRiot;
                }
                int iBaseTime = 0;

                if (MissionData.iLocationX == 1)
                    iBaseTime = 70000;
                else if (MissionData.iLocationX == 2)
                    iBaseTime = 52000;
                else if (MissionData.iLocationX == 3)
                    iBaseTime = 258000;
                else if (MissionData.iLocationX == 4)
                    iBaseTime = 68000;
                else if (MissionData.iLocationX == 5)
                    iBaseTime = 61000;
                else if (DataStore.bOnCayoLand)
                    iBaseTime = 99000;

                for (int i = 0; i < MissionData.iDeliverList.Count; i++)
                {
                    if (MissionData.iList_01[0] == 6)
                        MissionData.iCashReward += (MissionData.iDeliverList[i] * -1) / 100;
                    else
                    {
                        if ((MissionData.iDeliverList[i] * -1) < iBaseTime)
                            MissionData.iCashReward += 1000;
                    }
                }

                if (iRaceRiot == 4)
                    MissionData.iCashReward += 50;
                else if (iRaceRiot == 3)
                    MissionData.iCashReward += 100;
                else if (iRaceRiot == 2)
                    MissionData.iCashReward += 500;
                else
                    MissionData.iCashReward += 10000;

                MissionData.iDeliverList.Sort();
                int iBest = MissionData.iDeliverList[MissionData.iDeliverList.Count - 1];
                iBest = iBest * -1;
                ObjectHand.FindTheTime(iBest, 5, DataStore.MyLang.Othertext[52], false);
            }
        }
