        public static void MoneyMan_GetJack()
        {
            MissionData.iWait4Sec = Game.GameTime + 500;

            if (!Game.Player.Character.IsInVehicle(MissionData.VehTrackin_01))
            {
                int iRan = -99;
                float fFirst = 25.00f;
                for (int i = 0; i < MissionData.MultiPed.Count; i++)
                {
                    Ped Peddy = MissionData.MultiPed[i].MyPed;
                    float fDis = Peddy.Position.DistanceTo(MissionData.VehTrackin_01.Position);
                    if (Peddy.IsInVehicle(MissionData.VehTrackin_01))
                    {

                    }
                    else
                    {
                        if (fDis < fFirst)
                        {
                            fFirst = fDis;
                            iRan = i;
                        }
                    }
                }

                if (iRan != -99)
                {
                    Ped Peddy = MissionData.MultiPed[iRan].MyPed;
                    if (!MissionData.BeOnOff[3])
                    {
                        Peddy.Task.ClearAll();
                        Peddy.AlwaysKeepTask = true;
                        Peddy.BlockPermanentEvents = true;
                        Function.Call(Hash.TASK_ENTER_VEHICLE, Peddy.Handle, MissionData.VehTrackin_01.Handle, -1, -1, 2.00f, 1, 0);
                        while (!Peddy.IsInVehicle() && !Peddy.IsDead && Peddy.Position.DistanceTo(MissionData.VehTrackin_01.Position) < 15)
                            Script.Wait(100);
                        Peddy.Task.CruiseWithVehicle(MissionData.VehTrackin_01, 55.00f, 0);
                        MissionData.BeOnOff[3] = true;
                        MissionData.iCashReward *= 4;
                        MissionData.iGotYourVan = Game.GameTime + 60000;
                    }
                }
            }
            else
            {
                for (int i = 0; i < MissionData.MultiPed.Count; i++)
                {
                    Ped Peddy = MissionData.MultiPed[i].MyPed;
                    if (Peddy.IsDead)
                    {
                        if (Peddy.CurrentBlip.Exists())
                            Peddy.CurrentBlip.Remove();
                    }
                    else if (MissionData.BeOnOff[2])
                    {
                        if (Peddy.Position.DistanceTo(MissionData.VehTrackin_01.Position) < 25.00f && !Peddy.Weapons.HasWeapon(WeaponHash.Bat))
                        {
                            if (MissionData.VehTrackin_01.IsStopped)
                            {
                                ObjectBuild.GetOutofVeh(Peddy, 1);
                                ObjectBuild.ArmNpcWeapon("WEAPON_bat", Peddy);
                                ObjectBuild.ArmsRegulator(Peddy, 3);
                            }
                        }
                        else if (!MissionData.VehTrackin_01.IsStopped && Peddy.Weapons.HasWeapon(WeaponHash.Bat) && Peddy.Position.DistanceTo(MissionData.VehTrackin_01.Position) > 35.00f)
                        {
                            Peddy.Weapons.RemoveAll();
                            ObjectBuild.ArmsRegulator(Peddy, 4);
                            Peddy.Task.VehicleChase(Game.Player.Character);
                        }
                    }
                }
            }

            ObjectHand.MultiPedTracker();
        }
