        public static void Water03_RandDest(int iDests)
        {
            LoggerLight.LogThis("Water03_RandDest, iDests == " + iDests);

            MissionData.iDeliverList.Clear();
            MissionData.iCashReward = 0;
            int iRanRange = MissionData.VectorList_01.Count - 1;
            HashSet<int> numbers = new HashSet<int>();
            while (numbers.Count < iDests)
                numbers.Add(ReturnStuff.RandInt(0, iRanRange));

            while (iDests > 0)
            {
                iDests -= 1;
                MissionData.iDeliverList.Add(numbers.ElementAt(iDests));
            }

            MissionData.iDeliverList.Sort();
            for (int i = 0; i < MissionData.iDeliverList.Count; i++)
                MissionData.iCashReward = MissionData.iCashReward + MissionData.iDeliverList[i];

            MissionData.iCashReward = MissionData.iCashReward * 5;
        }
