        public static void Hitman_ManualAI()
        {
            bool bToArms = false;
            List<Ped> DeadPed = new List<Ped>();
            DeadPed.Clear();

            for (int i = 0; i < MissionData.PedList_01.Count; i++)
            {
                Ped pMe = MissionData.PedList_01[i];
                if (pMe.IsDead)
                {
                    DeadPed.Add(new Ped(pMe.Handle));
                    if (pMe.CurrentBlip.Exists())
                        pMe.CurrentBlip.Color = BlipColor.BlueLight;
                    else
                    {
                        pMe.AddBlip();
                        pMe.CurrentBlip.Scale = 0.75f;
                        pMe.CurrentBlip.Color = BlipColor.BlueLight;
                    }
                }
                else
                {
                    if (i == 3)
                    {
                        if (!pMe.IsWalking)
                            MissionData.iList_01[0] = ReturnStuff.PedWalkies(pMe, MissionData.VectorList_02, MissionData.iList_01[0]);
                        else if (pMe.Position.DistanceTo(MissionData.VectorList_02[MissionData.iList_01[0]]) < 1.00f)
                            pMe.Task.Wait(1000);
                    }
                    else if (i == 4)
                    {
                        if (!pMe.IsWalking)
                            MissionData.iList_01[1] = ReturnStuff.PedWalkies(pMe, MissionData.VectorList_03, MissionData.iList_01[1]);
                        else if (pMe.Position.DistanceTo(MissionData.VectorList_03[MissionData.iList_01[1]]) < 1.00f)
                            pMe.Task.Wait(1000);
                    }
                    else if (i == 5)
                    {
                        if (!pMe.IsWalking)
                            MissionData.iList_01[2] = ReturnStuff.PedWalkies(pMe, MissionData.VectorList_04, MissionData.iList_01[2]);
                        if (pMe.Position.DistanceTo(MissionData.VectorList_04[MissionData.iList_01[2]]) < 1.00f)
                            pMe.Task.Wait(1000);
                    }

                    if (!bToArms)
                    {
                        bToArms = ReturnStuff.BeenSpotted(pMe, Game.Player.Character, true);

                        if (bToArms)
                            pMe.CurrentBlip.Color = BlipColor.Pink;
                    }
                    else
                        break;
                }
            }

            if (DeadPed.Count > 0)
            {
                if (DeadPed.Count == 1)
                {
                    Ped IDead01 = DeadPed[0];
                    for (int i = 0; i < MissionData.PedList_01.Count; i++)
                    {
                        Ped pMe = MissionData.PedList_01[i];

                        if (!bToArms)
                            bToArms = ReturnStuff.BeenSpotted(pMe, IDead01, false);
                        else
                            break;
                    }
                }
                else if (DeadPed.Count == 2)
                {
                    Ped IDead01 = DeadPed[0];
                    Ped IDead02 = DeadPed[1];

                    for (int i = 0; i < MissionData.PedList_01.Count; i++)
                    {
                        Ped pMe = MissionData.PedList_01[i];
                        if (!bToArms)
                            bToArms = ReturnStuff.BeenSpotted(pMe, IDead01, false);
                        else
                            break;

                        if (!bToArms)
                            bToArms = ReturnStuff.BeenSpotted(pMe, IDead02, false);
                        else
                            break;
                    }
                }
                else if (DeadPed.Count == 3)
                {
                    Ped IDead01 = DeadPed[0];
                    Ped IDead02 = DeadPed[1];
                    Ped IDead03 = DeadPed[2];

                    for (int i = 0; i < MissionData.PedList_01.Count; i++)
                    {
                        Ped pMe = MissionData.PedList_01[i];
                        if (!bToArms)
                            bToArms = ReturnStuff.BeenSpotted(pMe, IDead01, false);
                        else
                            break;

                        if (!bToArms)
                            bToArms = ReturnStuff.BeenSpotted(pMe, IDead02, false);
                        else
                            break;

                        if (!bToArms)
                            bToArms = ReturnStuff.BeenSpotted(pMe, IDead03, false);
                        else
                            break;
                    }
                }
                else if (DeadPed.Count == 4)
                {
                    Ped IDead01 = DeadPed[0];
                    Ped IDead02 = DeadPed[1];
                    Ped IDead03 = DeadPed[2];
                    Ped IDead04 = DeadPed[3];

                    for (int i = 0; i < MissionData.PedList_01.Count; i++)
                    {
                        Ped pMe = MissionData.PedList_01[i];
                        if (!bToArms)
                            bToArms = ReturnStuff.BeenSpotted(pMe, IDead01, false);
                        else
                            break;

                        if (!bToArms)
                            bToArms = ReturnStuff.BeenSpotted(pMe, IDead02, false);
                        else
                            break;

                        if (!bToArms)
                            bToArms = ReturnStuff.BeenSpotted(pMe, IDead03, false);
                        else
                            break;

                        if (!bToArms)
                            bToArms = ReturnStuff.BeenSpotted(pMe, IDead04, false);
                        else
                            break;
                    }
                }
            }

            if (bToArms)
            {
                for (int i = 0; i < MissionData.PedList_01.Count; i++)
                {
                    if (MissionData.PedList_01[i].IsAlive)
                    {
                        MissionData.PedList_01[i].Task.FightAgainst(Game.Player.Character);
                        MissionData.PedList_01[i].AlwaysKeepTask = true;
                    }
                }
                MissionData.Npc_01.Task.FleeFrom(Game.Player.Character);
                Function.Call((Hash)0xD30C50DF888D58B5, MissionData.Npc_01.Handle, false);
                Function.Call((Hash)0x0C4BBF625CA98C4E, MissionData.Npc_01.Handle, false);
                MissionData.PedList_01.Remove(MissionData.Npc_01);
                MissionData.Npc_01.MarkAsNoLongerNeeded();
                MissionData.iMissionSeq = 40;
            }
            MissionData.BeOnOff[1] = true;
        }
