        public static void BikerRaids_KeepWalkin()
        {
            for (int i = 0; i < MissionData.MishPed.Count; i++)
            {
                Ped Pedx = MissionData.MishPed[i];
                if (Pedx.IsDead)
                    MissionData.iMissionSeq = 44;
                else if (!Pedx.IsInVehicle(MissionData.VehTrackin_01))
                {
                    if (Pedx.Position.DistanceTo(MissionData.VectorList_03[MissionData.VectorList_03.Count - 1]) < 1.50f)
                    {
                        if (Pedx.CurrentBlip.Exists())
                            Pedx.CurrentBlip.Remove();
                        ObjectBuild.WarptoAnyVeh(MissionData.VehTrackin_01, Pedx, MissionData.iMissionVar_03);
                        MissionData.MishPed.Remove(Pedx);
                        MissionData.iMissionVar_03 = MissionData.iMissionVar_03 + 1;
                    }
                    else if (Game.Player.IsTargetting(Pedx))
                    {
                        Pedx.Task.ClearAll();
                        ObjectHand.WalkThisWay(Pedx, MissionData.VectorList_03[MissionData.VectorList_03.Count - 1], 1.00f);
                    }
                    else
                    {
                        Pedx.Task.ClearAll();
                        Pedx.Task.Cower(-1);
                    }
                }
            }
            MissionData.iWait4Sec = Game.GameTime + 2000;
        }
        public static void BikerRaids_LostMCAtt()
        {
            MissionData.iTracking = Game.GameTime + 1000;

            ObjectHand.MultiPedTracker();

            for (int i = 0; i < MissionData.MultiPed.Count; i++)
            {
                if (MissionData.MultiPed[i].MyPed.Exists())
                {
                    if (MissionData.MultiPed[i].MyPed.Position.DistanceTo(Game.Player.Character.Position) > 450.00f || Game.Player.Character.Position.DistanceTo(MissionData.vTarget_01) < 250.00f)
                    {
                        MissionData.MultiPed[i].MyPed.Task.FleeFrom(Game.Player.Character);
                        if (MissionData.MultiPed[i].MyBlip != null)
                            MissionData.MultiPed[i].MyBlip.Remove();

                        ObjectHand.ReadWriteBlips(false, false, -1, -1, MissionData.MultiPed[i].MyPed.Handle, -1, -1, -1);
                        MissionData.PedList_01.Remove(MissionData.MultiPed[i].MyPed);
                        MissionData.MultiPed[i].MyPed.MarkAsNoLongerNeeded();
                        MissionData.MultiPed.RemoveAt(i);
                    }
                }
                else
                    MissionData.MultiPed.RemoveAt(i);
            }

            if (MissionData.iTime_01[0] < Game.GameTime)
            {
                if (MissionData.iMissionVar_01 == 2)
                {
                    if (MissionData.MultiPed.Count + SearchFor.MakeCarz.Count < 6)
                        SearchFor.SearchVeh(35.00f, 150.00f, ReturnStuff.RanVehListX(4, 5, false), false, false, false, false, 8, 4, 1, DataStore.MyLang.Maptext[20], 0, false, true);
                }
                else
                {
                    if (MissionData.MultiPed.Count + SearchFor.MakeCarz.Count < 6 && Game.Player.Character.Position.DistanceTo(MissionData.vTarget_01) > 250.00f)
                        SearchFor.SearchVeh(35.00f, 150.00f, ReturnStuff.RanVehListX(4, 5, false), false, false, false, false, 8, 2, 1, DataStore.MyLang.Maptext[20], 0, false, true);
                    else
                        MissionData.iTime_01[0] = Game.GameTime + ReturnStuff.RandInt(30000, 45000);
                }
            }
        }
