        public static void CargoCollect_Suprise()
        {
            LoggerLight.LogThis("CargoCollect_Suprise");

            ObjectHand.CleanUpPeds(ObjectHand.ConvertToHandle(null, MissionData.PedList_01, null, null), true, false);
            MissionData.PedList_01.Clear();
            Game.Player.Character.CanBeDraggedOutOfVehicle = true;
            MissionData.iMissionVar_03 = ReturnStuff.FindRandom(14, 1, 5);

            if (MissionData.iMissionVar_03 == 1)
            {
                SearchFor.SearchVeh(35.00f, 150.00f, ReturnStuff.RanVehListX(18, 1, false), false, false, false, false, 8, 1, 1, DataStore.MyLang.Maptext[20], 0, true, true);
                SearchFor.SearchVeh(35.00f, 150.00f, ReturnStuff.RanVehListX(18, 1, false), false, false, false, false, 8, 1, 1, DataStore.MyLang.Maptext[20], 0, true, true);
                MissionData.iCashReward += 4000;
            }            // Arena vehicle chase
            else if (MissionData.iMissionVar_03 == 2)
            {
                ObjectHand.AddDogFighters(3);
                MissionData.iCashReward += 15000;
            }       // Hydra attack
            else if (MissionData.iMissionVar_03 == 3)
            {
                Vector3 NewV = (Game.Player.Character.Position) - (Game.Player.Character.ForwardVector * 500);
                NewV.Z = NewV.Z + 500.00f;
                Vehicle Vehic = ObjectBuild.VehicleSpawn(ReturnStuff.RanVehListX(2, 3, false), NewV, Game.Player.Character.Heading, false, false, false, false, 2, 7, 3, DataStore.MyLang.Maptext[20], 0, false);
                ObjectBuild.MaxOutAllModsNoWheels(Vehic);
                MissionData.iCashReward += 12000;
            }       // helli attack -- Make it work
            else if (MissionData.iMissionVar_03 == 4)
            {
                int iCountEm = ReturnStuff.RandInt(5, 10);
                for (int i = 0; i < iCountEm; i++)
                    SearchFor.SearchPed(1.00f, 75.00f, "", false, 220, 37, 0, null, 0, true, 1, 2, "");
                MissionData.iCashReward += 10000;
            }       // Green Suit Mele Attack 
            else
            {
                MissionData.iCashReward += 1000;
            }                                // No attacks
        }
