        public static void TempAgency_01_Formation()
        {
            LoggerLight.LogThis("TempAgency_01_Formation");
            Game.FadeScreenOut(1000);
            Script.Wait(900);
            for (int i = 0; i < MissionData.VehicleList_01.Count() - 1; i++)
            {
                MissionData.VehicleList_01[i].Position = MissionData.VectorList_01[i];
                MissionData.VehicleList_01[i].Heading = MissionData.fList_01[i];

                MissionData.VehicleList_01[i].FreezePosition = true;
            }

            Game.FadeScreenIn(1000);

            if (MissionData.BeOnOff[0])
            {
                MissionData.BeOnOff[0] = false;
                MissionData.iMissionVar_02 = 5;
                Racist_CountDown(MissionData.vTarget_03, false);
            }
            MissionData.Prop_01.Position = MissionData.vTarget_03;

            for (int i = 0; i < MissionData.VehicleList_01.Count(); i++)
            {
                MissionData.VehicleList_01[i].FreezePosition = false;

                if (MissionData.VehTrackin_01 == MissionData.VehicleList_01[i])
                {

                }
                else if (Game.Player.Character.CurrentVehicle != MissionData.VehicleList_01[i])
                {
                    if (!MissionData.PedList_01[i].IsInVehicle())
                        ObjectBuild.WarptoAnyVeh(MissionData.VehicleList_01[i], MissionData.PedList_01[i], 1);

                    TempAgency_01_ChaseTheBall(MissionData.PedList_01[i], MissionData.VehicleList_01[i]);
                }
            }

            if (MissionData.BeOnOff[1])
                MissionData.iMishText = 187;
            else
                MissionData.iMishText = 188;

            UiDisplay.ttTextBar_01.Text = "" + MissionData.iMissionVar_01 + "/" + MissionData.iMissionVar_03 + "";
        }
