            ObjectHand.ReadWriteBlips(false, true, Blip.Handle, -1, -1, -1, -1, -1);
        }
        public static void TempAgency_01_ExitWithCar(bool bFail)
        {
            LoggerLight.LogThis("TempAgency_01_ExitWithCar, bFail == " + bFail);
            MissionData.VehTrackin_01.LockStatus = VehicleLockStatus.Unlocked;
            if (MissionData.iMissionVar_01 > MissionData.iMissionVar_03)
                MissionData.VehTrackin_01.PrimaryColor = VehicleColor.MetallicBlazeRed;
            else
                MissionData.VehTrackin_01.PrimaryColor = VehicleColor.MetaillicVDarkBlue;
            if (!bFail)
                ObjectBuild.WarptoAnyVeh(MissionData.VehTrackin_01, Game.Player.Character, 1);
            Game.Player.Character.CurrentVehicle.Position = MissionData.vTarget_05;
            Game.Player.Character.CurrentVehicle.Heading = MissionData.fMission_02;

            if (!bFail)
                MissionData.iCashReward = 10000;
            else
                MissionData.iCashReward = 50;
            LoadInMissionIPLs(11, false, false);
            GameOver(bFail, "", false, MissionData.iCashReward);
        }
        public static void TempAgency_02_ClubQUe()
        {
            Script.Wait(1000);
            List<string> sTings = new List<string>
            {
                "prop_dumpster_01a",
                "prop_dumpster_02b",
                "prop_boxpile_02d",
                "prop_rub_boxpile_04",
                "prop_rub_boxpile_06",
                "prop_rub_boxpile_08",
                "prop_rub_cardpile_01",
                "prop_rub_cardpile_03",
                "prop_bin_07b"
            };

            Prop[] Opensesme = World.GetNearbyProps(MissionData.vTarget_01, 10.00f);

            for (int i = 0; i < Opensesme.Count(); i++)
            {
                if (ReturnStuff.PropExists(Opensesme, i))
                {
                    Prop ThisTrash = Opensesme[i];
                    for (int ii = 0; ii < sTings.Count; ii++)
                    {
                        if (Function.Call<int>(Hash.GET_HASH_KEY, sTings[ii]) == ThisTrash.Model)
                        {
                            ThisTrash.Delete();
                            break;
                        }
                    }
                }
            }
            for (int i = 1; i < MissionData.VectorList_01.Count - 1; i++)
                ObjectBuild.NPCSpawn(ReturnStuff.RandNPC(54), MissionData.VectorList_01[i], MissionData.fList_01[i], false, 130, 0, 0, null, 0, false, 0, 0, "");

            ObjectBuild.NPCSpawn("s_m_m_bouncer_01", MissionData.VectorList_01[MissionData.VectorList_01.Count - 1], MissionData.fList_01[MissionData.VectorList_01.Count - 1], false, 250, 0, 0, null, 0, false, 0, 0, "");
        }
