        public static void TempAgency_02_AddRubish()
        {
            if (MissionData.PopLists.Prop.Count > 5)
            {
                int iRan = ReturnStuff.RandInt(1, 3);
                for (int i = 0; i < iRan; i++)
                {
                    int iGot = ReturnStuff.RandInt(0, MissionData.PopLists.Prop.Count -1);
                    ObjectBuild.BuildProp(MissionData.PopLists.Prop[iGot], MissionData.PopLists.Pos[iGot], MissionData.PopLists.Rot[iGot], false, false);
                    MissionData.PopLists.Prop.RemoveAt(iGot);
                    MissionData.PopLists.Pos.RemoveAt(iGot);
                    MissionData.PopLists.Rot.RemoveAt(iGot);
                }
            }
            else if (MissionData.PopLists.Prop.Count > 0)
            {
                ObjectBuild.BuildProp(MissionData.PopLists.Prop[MissionData.PopLists.Prop.Count -1], MissionData.PopLists.Pos[MissionData.PopLists.Prop.Count - 1], MissionData.PopLists.Rot[MissionData.PopLists.Prop.Count - 1], false, false);
                MissionData.PopLists.Prop.RemoveAt(MissionData.PopLists.Prop.Count - 1);
                MissionData.PopLists.Pos.RemoveAt(MissionData.PopLists.Prop.Count - 1);
                MissionData.PopLists.Rot.RemoveAt(MissionData.PopLists.Prop.Count - 1);
            }
        }
        public static void TempAgency_02_BarStools()
        {
            for (int i = 0; i < MissionData.VectorList_04.Count; i++)
            {
                Prop[] Opensesme = World.GetNearbyProps(MissionData.VectorList_04[i], 4.00f);
                for (int ii = 0; ii < Opensesme.Count(); ii++)
                {
                    Prop ThisTrash = Opensesme[ii];
                    if (Function.Call<int>(Hash.GET_HASH_KEY, "ba_prop_int_stool_low") == ThisTrash.Model || Function.Call<int>(Hash.GET_HASH_KEY, "ba_prop_int_edgy_stool") == ThisTrash.Model || Function.Call<int>(Hash.GET_HASH_KEY, "ba_prop_int_glam_stool") == ThisTrash.Model)
                        ThisTrash.Delete();
                }
            }

            Prop[] Bin = World.GetNearbyProps(new Vector3(-1583.90735f, -3009.52295f, -77.0045547f), 2.00f);
            for (int i = 0; i < Bin.Count(); i++)
            {
                Prop ThisTrash = Bin[i];
                if (Function.Call<int>(Hash.GET_HASH_KEY, "prop_bin_11a") == ThisTrash.Model)
                    ThisTrash.Delete();
            }
        }
        public static void TempAgency_02_CleanOutClub()
        {
            for (int i = 0; i < MissionData.MultiPed.Count; i++)
            {
                if (MissionData.MultiPed[i].MyTask_02 != -1)
                    Function.Call(Hash.DELETE_CHECKPOINT, MissionData.MultiPed[i].MyTask_02);
            }
        }
        public static void TempAgency_02_RunForTHeHills()
        {
            MissionData.iKeepDance = Game.GameTime + 1000;
            List<string> DancinFool = new List<string>();
            int iGetDrink = -1;

            if (MissionData.BeOnOff[0] && ReturnStuff.RandInt(0, 20) < 15)
                iGetDrink = ReturnStuff.RandInt(0, MissionData.MultiPed.Count - 1);

            if (MissionData.fMission_03 > 0.95f)
            {
                TempAgency_02_CleanOutClub();
                float fMoreAnger = 0.00f;
                Ped PAngry = null;
                for (int i = 0; i < MissionData.MultiPed.Count; i++)
                {
                    if (MissionData.MultiPed[i].MyFloat_01 > fMoreAnger)
                    {
                        fMoreAnger = MissionData.MultiPed[i].MyFloat_01;
                        PAngry = MissionData.MultiPed[i].MyPed;
                    }
                }
                MissionData.MultiPed.Clear();
                ObjectBuild.ArmsRegulator(PAngry, 4);
                ObjectBuild.AttackThePlayer(PAngry, false);

                for (int i = 0; i < MissionData.MishPed.Count; i++)
                    ObjectBuild.FightingXPed(MissionData.MishPed[i], PAngry);

                MissionData.iMissionSeq = 7;
            }
            else
            {
                for (int i = 0; i < MissionData.MultiPed.Count; i++)
                {
                    bool bMale = false;
                    int iRan = ReturnStuff.RandInt(1, 3);

                    if (MissionData.MultiPed[i].MySwitch_01)
                    {
                        if (MissionData.MultiPed[i].MySwitch_02)
                        {
                            if (MissionData.MultiPed[i].MyPed.Position.DistanceTo(MissionData.MultiPed[i].MyTarget_01) < 3.00f)
                            {
                                MissionData.MultiPed[i].MySwitch_01 = false;
                                MissionData.MultiPed[i].MySwitch_02 = false;
                                MissionData.MultiPed[i].MySwitch_03 = false;
                            }
                            else
                            {
                                if (MissionData.MultiPed[i].MyTask_03 > 8)
                                {
                                    if (Function.Call<int>(Hash.GET_NAVMESH_ROUTE_RESULT, MissionData.MultiPed[i].MyPed.Handle) != 3)
                                    {
                                        MissionData.MultiPed[i].MySwitch_01 = false;
                                        MissionData.MultiPed[i].MySwitch_02 = false;
                                        MissionData.MultiPed[i].MySwitch_03 = false;
                                    }
                                }
                                else
                                {
                                    ObjectHand.WalkThisWay(MissionData.MultiPed[i].MyPed, MissionData.MultiPed[i].MyTarget_01, 1.00f);
                                    MissionData.MultiPed[i].MyTask_03 += 1;
                                }
                            }
                        }
                        else
                        {
                            if (MissionData.MultiPed[i].MyPed.Position.DistanceTo(MissionData.VectorList_04[MissionData.MultiPed[i].MyTask_01]) < 1.5f)
                            {
                                if (Game.Player.Character.Position.DistanceTo(MissionData.VectorList_05[MissionData.MultiPed[i].MyTask_01]) < 1.25f && MissionData.BeOnOff[0])
                                {
                                    MissionData.iMishText = 201;
                                    MissionData.BeOnOff[0] = false;
                                    MissionData.fMission_03 -= MissionData.MultiPed[i].MyFloat_01;
                                    MissionData.MultiPed[i].MyFloat_01 = 0.00f;
                                    Function.Call(Hash.DELETE_CHECKPOINT, MissionData.MultiPed[i].MyTask_02);
                                    MissionData.MultiPed[i].MyTask_02 = -1;
                                    MissionData.MultiPed[i].MyTask_03 = -1;
                                    MissionData.MultiPed[i].MyPed.Task.AchieveHeading(MissionData.fList_03[MissionData.MultiPed[i].MyTask_01], -1);
                                    TempAgency_02_HaveADrink(Game.Player.Character, MissionData.MultiPed[i].MyPed, MissionData.VectorList_05[MissionData.MultiPed[i].MyTask_01], MissionData.VectorList_04[MissionData.MultiPed[i].MyTask_01]);
                                    ObjectHand.AddTarget(MissionData.vTarget_03, true, true, 1.00f, false, 93, DataStore.MyLang.Maptext[74]);
                                    UiDisplay.TheYellowCorona(MissionData.vTarget_03, 1.00f);
                                    MissionData.iList_02.Add(MissionData.MultiPed[i].MyTask_01);
                                    MissionData.MultiPed[i].MySwitch_02 = true;
                                    MissionData.MultiPed[i].MyPed.Task.ClearAllImmediately();
                                    ObjectHand.WalkThisWay(MissionData.MultiPed[i].MyPed, MissionData.MultiPed[i].MyTarget_01, 1.00f);
                                    MissionData.iMissionSeq += 1;
                                }
                                else
                                {
                                    if (!MissionData.MultiPed[i].MySwitch_03)
                                    {
                                        MissionData.MultiPed[i].MySwitch_03 = true;
                                        MissionData.MultiPed[i].MyTask_02 = ReturnStuff.MyCorona(MissionData.VectorList_05[MissionData.MultiPed[i].MyTask_01], 0.75f);
                                        Function.Call(Hash.TASK_TURN_PED_TO_FACE_ENTITY, MissionData.MultiPed[i].MyPed.Handle, Game.Player.Character.Handle, -1);
                                    }
                                    MissionData.fMission_03 += 0.01f;
                                    MissionData.MultiPed[i].MyFloat_01 += 0.01f;
                                }
                            }
                            else
                            {
                                if (Function.Call<int>(Hash.GET_NAVMESH_ROUTE_RESULT, MissionData.MultiPed[i].MyPed.Handle) != 3)
                                {
                                    if (MissionData.MultiPed[i].MyTask_03 > 8)
                                    {
                                        MissionData.MultiPed[i].MyPed.Task.ClearAll();
                                        MissionData.iList_02.Add(MissionData.MultiPed[i].MyTask_01);
                                        MissionData.fMission_03 -= MissionData.MultiPed[i].MyFloat_01;
                                        MissionData.MultiPed[i].MyFloat_01 = 0.00f;
                                        if (MissionData.MultiPed[i].MyTask_02 != -1)
                                            Function.Call(Hash.DELETE_CHECKPOINT, MissionData.MultiPed[i].MyTask_02);
                                        MissionData.MultiPed[i].MyTask_02 = -1;
                                        MissionData.MultiPed[i].MyPed.Task.ClearAllImmediately();
                                        ObjectHand.WalkThisWay(MissionData.MultiPed[i].MyPed, MissionData.MultiPed[i].MyTarget_01, 1.00f);
                                        MissionData.MultiPed[i].MySwitch_02 = true;
                                    }
                                    else
                                    {
                                        ObjectHand.WalkThisWay(MissionData.MultiPed[i].MyPed, MissionData.VectorList_04[MissionData.MultiPed[i].MyTask_01], 1.00f);
                                        MissionData.MultiPed[i].MyTask_03 += 1;
                                    }
                                }
                            }
                        }
                    }
                    else
                    {
                        if (i == iGetDrink && MissionData.iList_02.Count > 0)
                        {
                            MissionData.MultiPed[i].MyPed.Task.ClearAllImmediately();
                            MissionData.MultiPed[i].MyTarget_01 = MissionData.MultiPed[i].MyPed.Position;
                            int iQue = ReturnStuff.RandInt(0, MissionData.iList_02.Count - 1);
                            MissionData.MultiPed[i].MyTask_01 = MissionData.iList_02[iQue];
                            ObjectHand.WalkThisWay(MissionData.MultiPed[i].MyPed, MissionData.VectorList_04[MissionData.MultiPed[i].MyTask_01], 1.00f);
                            MissionData.iList_02.RemoveAt(iQue);
                            MissionData.MultiPed[i].MySwitch_01 = true;
                            MissionData.MultiPed[i].MyTask_03 = -1;
                        }
                        else if (MissionData.MultiPed[i].MyPed.IsFleeing)
                            ObjectHand.WalkThisWay(MissionData.MultiPed[i].MyPed, MissionData.vTarget_02, 2.00f);
                        else if (MissionData.MultiPed[i].MyPed.Position.DistanceTo(MissionData.vTarget_02) < 2.50f)
                        {
                            MissionData.MultiPed[i].MyPed.Position = MissionData.vTarget_01;
                            MissionData.MultiPed.RemoveAt(i);
                        }
                        else if (!Function.Call<bool>(Hash.GET_IS_TASK_ACTIVE, MissionData.MultiPed[i].MyPed.Handle, 134))
                        {
                            MissionData.MultiPed[i].MyPed.Task.ClearAll();

                            if (MissionData.MultiPed[i].MyPed.Gender == Gender.Male)
                                bMale = true;

                            DancinFool = ReturnStuff.DanceList(bMale, iRan);

                            ObjectBuild.ForceAnim(MissionData.MultiPed[i].MyPed, DancinFool[0], DancinFool[1], MissionData.MultiPed[i].MyPed.Position, MissionData.MultiPed[i].MyPed.Rotation);
                        }
                    }
                }
            }
        }
        public static void TempAgency_02_HaveADrink(Ped BarStaff, Ped Drinker, Vector3 Bar, Vector3 Cust)
        {
            LoggerLight.LogThis("TempAgency_02_HaveADrink");
            Script.Wait(1000);

            byte iLoop = 10;
            BarStaff.Task.ClearAllImmediately();
            Drinker.Task.ClearAllImmediately();

            while (Drinker.Position.DistanceTo(Cust) > 1.00f && iLoop > 0)
            {
                ObjectHand.WalkThisWay(Drinker, Cust, 1.00f);
                Script.Wait(500);
                iLoop--;
            }
            iLoop = 10;

            while (BarStaff.Position.DistanceTo(Bar) > 1.50f && iLoop > 0)
            {
                ObjectHand.WalkThisWay(BarStaff, Bar, 1.00f);
                Script.Wait(500);
                iLoop--;
            }
            BarStaff.Task.ClearAllImmediately();
            Drinker.Task.ClearAllImmediately();

            Function.Call(Hash.TASK_TURN_PED_TO_FACE_ENTITY, Drinker.Handle, BarStaff.Handle, -1);
            Function.Call(Hash.TASK_TURN_PED_TO_FACE_ENTITY, BarStaff.Handle, Drinker.Handle, -1);

            Script.Wait(3000);

            ObjectBuild.ForceAnimOnce(Drinker, "anim@amb@nightclub@mini@drinking@bar@drink@one", "one_player", Drinker.Position, Drinker.Rotation);
            ObjectBuild.ForceAnimOnce(BarStaff, "anim@amb@nightclub@mini@drinking@bar@drink@one", "one_bartender", BarStaff.Position, BarStaff.Rotation);

            Script.Wait(1000);

            while (Function.Call<bool>(Hash.GET_IS_TASK_ACTIVE, BarStaff.Handle, 134))
                Script.Wait(100);

            BarStaff.Task.ClearAllImmediately();
        }
        public static void TempAgency_03_TrackDump()
        {
            List<Vehicle> Vamos = new List<Vehicle>();
            bool bLastOne = false;

            for (int i = 0; i < MissionData.VehicleList_01.Count; i++)
            {
                if (MissionData.VehicleList_01[i].Position.DistanceTo(new Vector3(-1267.219f, -2981.585f, -44.04432f)) < 3.50f)
                {
                    if (MissionData.VehicleList_01[i] != MissionData.VehTrackin_01 && MissionData.VehicleList_01[i] != MissionData.VehTrackin_02)
                        Vamos.Add(new Vehicle(MissionData.VehicleList_01[i].Handle));
                }

            }
            if (Vamos.Count > 3)
            {
                if (MissionData.iMissionVar_01 == 3)
                    bLastOne = true;

                int iPass = 0;
                while (iPass < 4)
                {
                    Script.Wait(1000);
                    for (int i = 0; i < Vamos.Count; i++)
                        Vamos[i].Alpha = 120;
                    MissionData.VehTrackin_01.Alpha = 120;
                    Script.Wait(500);
                    for (int i = 0; i < Vamos.Count; i++)
                        Vamos[i].Alpha = 255;
                    MissionData.VehTrackin_01.Alpha = 255;
                    iPass += 1;
                }
                if (bLastOne)
                {
                    for (int i = 0; i < Vamos.Count; i++)
                    {
                        Vector3 MyOffSett = Function.Call<Vector3>(Hash.GET_OFFSET_FROM_ENTITY_GIVEN_WORLD_COORDS, MissionData.VehTrackin_01.Handle, Vamos[i].Position.X, Vamos[i].Position.Y, Vamos[i].Position.Z);
                        Function.Call(Hash.ATTACH_ENTITY_TO_ENTITY, Vamos[i].Handle, MissionData.VehTrackin_01.Handle, 42, MyOffSett.X, MyOffSett.Y, MyOffSett.Z, Vamos[i].Rotation.X, Vamos[i].Rotation.Y, Vamos[i].Rotation.Z, false, false, true, false, 2, true);
                    }
                    ObjectBuild.WarptoAnyVeh(MissionData.VehTrackin_01, Game.Player.Character, 1);

                    if (MissionData.VehTrackin_01.CurrentBlip.Exists())
                        MissionData.VehTrackin_01.CurrentBlip.Remove();
                }
                else
                {
                    for (int i = 0; i < Vamos.Count; i++)
                    {
                        Vector3 MyOffSett = Function.Call<Vector3>(Hash.GET_OFFSET_FROM_ENTITY_GIVEN_WORLD_COORDS, MissionData.VehTrackin_01.Handle, Vamos[i].Position.X, Vamos[i].Position.Y, Vamos[i].Position.Z);
                        Function.Call(Hash.ATTACH_ENTITY_TO_ENTITY, Vamos[i].Handle, MissionData.VehTrackin_01.Handle, 42, MyOffSett.X, MyOffSett.Y, MyOffSett.Z, Vamos[i].Rotation.X, Vamos[i].Rotation.Y, Vamos[i].Rotation.Z, false, false, true, false, 2, true);
                        Vamos[i].Alpha = 255;
                    }
                }
                MissionData.VehTrackin_01.Alpha = 255;
                MissionData.VehTrackin_01.Position = MissionData.VectorList_01[MissionData.iMissionVar_01];
                MissionData.VehTrackin_01.Heading = 224.6757f;
                MissionData.iMissionVar_01 += 1;

                if (bLastOne)
                {
                    if (MissionData.VehTrackin_02.CurrentBlip.Exists())
                        MissionData.VehTrackin_02.CurrentBlip.Remove();

                    for (int i = 0; i < MissionData.VehicleList_01.Count; i++)
                    {
                        if (MissionData.VehicleList_01[i].Model == VehicleHash.Dump)
                        {
                            if (MissionData.VehicleList_01[i].IsSeatFree(VehicleSeat.Driver))
                                ObjectBuild.NPCSpawn("s_m_y_armymech_01", MissionData.VehicleList_01[i].Position, 0.00f, true, 220, 0, 1, MissionData.VehicleList_01[i], 0, false, 0, 0, "");
                        }
                        else
                            MissionData.VehicleList_01[i].Detach();
                    }
                    MissionData.iMissionSeq += 1;
                }
                else
                {
                    MissionData.VehTrackin_01 = ObjectBuild.VehicleSpawn("Dump", new Vector3(-1267.00818f, -2979.18091f, -48.1399612f), -0.0233801287f, false, false, false, false, 1, 0, 5, DataStore.MyLang.Maptext[76], 0, false);
                    MissionData.MishVic.Add(new Vehicle(MissionData.VehTrackin_01.Handle));
                }
            }
        }
