        public static void TempAgency_06_PlayerAttacks()
        {
            for (int i = 14; i < MissionData.VehicleList_01.Count; i++)
                MissionData.VehicleList_01[i].Explode();

            //Kanjally ???
            for (int i = 0; i < MissionData.PedList_01.Count; i++)
            {
                if (MissionData.PedList_01[i].Model == PedHash.Scientist01SMM || MissionData.PedList_01[i].Model == PedHash.Construct01SMY || MissionData.PedList_01[i].Model == PedHash.Construct02SMY)
                {
                    MissionData.PedList_01[i].Task.ReactAndFlee(Game.Player.Character);
                    MissionData.PedList_01.Remove(MissionData.PedList_01[i]);
                    MissionData.PedList_01[i].MarkAsNoLongerNeeded();
                }
            }
            MissionData.PedList_01.Remove(MissionData.Npc_01);
            MissionData.PedList_01.Remove(MissionData.Npc_02);
            MissionData.Npc_01.MarkAsNoLongerNeeded();
            MissionData.Npc_02.MarkAsNoLongerNeeded();

            for (int i = 0; i < 4; i++)
            {
                Ped pMe = ObjectBuild.NPCSpawn("", MissionData.VectorList_01[0], 0.00f, true, 350, 0, 0, null, 3, true, 1, 1, DataStore.MyLang.Maptext[113]);
                PedMultiTask ThisPed = ObjectBuild.AddAMultiped();
                ThisPed.MyPed = new Ped(pMe.Handle);
                ThisPed.MyTask_01 = 1;
                ThisPed.MyBlip = ThisPed.MyPed.CurrentBlip;
                MissionData.MultiPed.Add(ThisPed);
                Function.Call(Hash.SET_ENTITY_ONLY_DAMAGED_BY_PLAYER, pMe.Handle, true);
                pMe.RelationshipGroup = DataStore.GP_BNPCs;
            }

            ObjectBuild.VehicleSpawn("Khanjali", new Vector3(591.25f, 5949.15f, -157.00f), 122.84f, false, false, false, false, 31, 0, 0, "", 0, false);
        }
        public static void TempAgency_06_PlayerBrains()
        {
            for (int i = 0; i < MissionData.MultiPed.Count; i++)
            {
                if (MissionData.MultiPed[i].MyPed.IsDead)
                {
                    if (MissionData.MultiPed[i].MyBlip != null)
                    {
                        MissionData.MultiPed[i].MyBlip.Remove();
                        MissionData.MultiPed[i].MyBlip = null;
                    }
                    MissionData.MultiPed.RemoveAt(i);
                }
                else if (MissionData.MultiPed[i].MySwitch_03)
                {
                    if (i < 2)
                    {
                        if (MissionData.MultiPed[i].MySwitch_01)
                        {
                            if (MissionData.MultiPed[i].MyTimer_01 < Game.GameTime)
                            {
                                MissionData.MultiPed[i].MyTask_01 += 1;
                                if (MissionData.MultiPed[i].MyTask_01 < MissionData.VectorList_02.Count)
                                    MissionData.MultiPed[i].MySwitch_01 = false;
                                else
                                    MissionData.iMissionSeq = 45;
                            }
                        }
                        else
                        {
                            if (!MissionData.MultiPed[i].MySwitch_02)
                            {
                                MissionData.MultiPed[i].MySwitch_02 = true;
                                MissionData.MultiPed[i].MyPed.Task.ClearAll();
                                Function.Call(Hash.SET_PED_FLEE_ATTRIBUTES, MissionData.MultiPed[i].MyPed.Handle, 0, true);
                                Function.Call(Hash.SET_PED_COMBAT_MOVEMENT, MissionData.MultiPed[i].MyPed.Handle, 2);
                                MissionData.MultiPed[i].MyPed.BlockPermanentEvents = true;
                                ObjectHand.WalkThisWay(MissionData.MultiPed[i].MyPed, MissionData.VectorList_02[MissionData.MultiPed[i].MyTask_01], 2.00f);
                            }
                            else if (MissionData.MultiPed[i].MyPed.Position.DistanceTo(MissionData.VectorList_02[MissionData.MultiPed[i].MyTask_01]) < 7.00f)
                            {
                                MissionData.MultiPed[i].MySwitch_02 = false;
                                MissionData.MultiPed[i].MySwitch_01 = true;
                                MissionData.MultiPed[i].MyTimer_01 = Game.GameTime + 6000;
                                MissionData.MultiPed[i].MyPed.Task.ClearAll();
                                MissionData.MultiPed[i].MyPed.BlockPermanentEvents = false;
                                Function.Call(Hash.SET_PED_COMBAT_MOVEMENT, MissionData.MultiPed[i].MyPed.Handle, 1);
                            }
                        }
                    }
                    else
                    {
                        if (MissionData.MultiPed[i].MySwitch_01)
                        {
                            if (MissionData.MultiPed[i].MyTimer_01 < Game.GameTime)
                            {
                                MissionData.MultiPed[i].MyTask_01 += 1;
                                if (MissionData.MultiPed[i].MyTask_01 < MissionData.VectorList_03.Count)
                                    MissionData.MultiPed[i].MySwitch_01 = false;
                                else
                                    MissionData.iMissionSeq = 45;
                            }
                        }
                        else
                        {
                            if (!MissionData.MultiPed[i].MySwitch_02)
                            {
                                MissionData.MultiPed[i].MySwitch_02 = true;
                                MissionData.MultiPed[i].MyPed.Task.ClearAll();
                                Function.Call(Hash.SET_PED_FLEE_ATTRIBUTES, MissionData.MultiPed[i].MyPed.Handle, 0, true);
