        public static void Parra_Load()
        {
            LoggerLight.LogThis("Parra_Load");
            MissionData.MultiPed.Clear();
            Game.Player.Character.FreezePosition = true;
            ObjectHand.GetWeaps(true);
            int iAddPlayer = ReturnStuff.RandInt(0, 11);
            int iPlussOne = 0;
            List<int> iSpot = new List<int>();
            for (int i = 0; i < MissionData.VectorList_03.Count; i++)
                iSpot.Add(i);

            for (int i = 0; i < MissionData.PropList_01.Count; i++)
            {
                for (int ii = 0; ii < MissionData.VectorList_01.Count; ii++)
                {
                    if (iAddPlayer == iPlussOne)
                    {
                        Function.Call(Hash.SET_PED_GADGET, Game.Player.Character.Handle, Function.Call<int>(Hash.GET_HASH_KEY, "GADGET_PARACHUTE"), true);
                        ObjectBuild.ForceAnim(Game.Player.Character, "amb@code_human_in_bus_passenger_idles@male@sit@base", "base", Game.Player.Character.Position, Game.Player.Character.Rotation);
                        Game.Player.Character.AttachTo(MissionData.PropList_01[i], 0, MissionData.VectorList_01[ii], MissionData.VectorList_02[ii]);
                    }
                    else
                    {
                        Ped PedShoot = ObjectBuild.NPCSpawn("", MissionData.PropList_01[i].Position, 0.00f, false, 250, 24, 0, null, 0, false, 0, 3, "");
                        ObjectBuild.ForceAnim(PedShoot, "amb@code_human_in_bus_passenger_idles@male@sit@base", "base", PedShoot.Position, PedShoot.Rotation);
                        PedShoot.AttachTo(MissionData.PropList_01[i], 0, MissionData.VectorList_01[ii], MissionData.VectorList_02[ii]);
                        Function.Call(Hash.SET_PED_GADGET, PedShoot.Handle, Function.Call<int>(Hash.GET_HASH_KEY, "GADGET_PARACHUTE"), true);
                        int iFinda = ReturnStuff.RandInt(0, iSpot.Count - 1);
                        int iLand = iSpot[iFinda];
                        iSpot.RemoveAt(iFinda);
                        PedMultiTask Para = ObjectBuild.AddAMultiped();
                        Para.MyPed = new Ped(PedShoot.Handle);
                        Para.MyTask_01 = 0;
                        Para.MyTask_02 = iLand + 1;
                        Para.MySwitch_01 = false;
                        Para.MySwitch_02 = true;
                        Para.MyTimer_01 = 0;
                        Para.MyTimer_02 = 0;
                        Para.MyTarget_01 = MissionData.VectorList_03[iLand];
                        MissionData.MultiPed.Add(Para);
                    }
                    iPlussOne += 1;
                }
            }
            Parra_AddStuff();
        }
        public static void Parra_Jump(bool bOneOut)
        {
            MissionData.iWait4Sec = Game.GameTime + ReturnStuff.RandInt(300, 1500);

            for (int i = 0; i < MissionData.MultiPed.Count; i++)
            {
                if (MissionData.MultiPed[i].MyPed.IsDead)
                {
                    MissionData.MultiPed[i].MyPed.Task.ClearAll();
                    MissionData.MultiPed.RemoveAt(i);
                }
                else if (MissionData.MultiPed[i].MyTask_01 == 0)
                {
                    if (MissionData.MultiPed[i].MyPed.IsAttached())
                    {
                        if (bOneOut)
                        {
                            if (ReturnStuff.RandInt(0, 40) > 20)
                            {
                                MissionData.MultiPed[i].MyPed.Detach();
                                break;
                            }
                        }
                        else
                            MissionData.MultiPed[i].MyPed.Detach();
                    }
                    else
                        MissionData.MultiPed[i].MyTask_01 = 1;
                }
                else if (MissionData.MultiPed[i].MyTask_01 == 1)
                {
                    Function.Call(Hash.TASK_SKY_DIVE, MissionData.MultiPed[i].MyPed.Handle);
                    MissionData.MultiPed[i].MyTask_01 = 2;
                }
                else if (MissionData.MultiPed[i].MyTask_01 == 2)
                {
                    if (MissionData.MultiPed[i].MyPed.Position.Z < 550.00f)
                    {
                        Function.Call(Hash.TASK_PARACHUTE, MissionData.MultiPed[i].MyPed.Handle);
                        Function.Call(Hash.FORCE_PED_TO_OPEN_PARACHUTE, MissionData.MultiPed[i].MyPed.Handle);
                        Function.Call(Hash.TASK_PARACHUTE_TO_TARGET, MissionData.MultiPed[i].MyPed.Handle, MissionData.MultiPed[i].MyTarget_01.X, MissionData.MultiPed[i].MyTarget_01.Y, MissionData.MultiPed[i].MyTarget_01.Z);
                        MissionData.MultiPed[i].MySwitch_01 = false;
                        MissionData.MultiPed[i].MyTask_01 = 3;
                    }
                }
                else if (MissionData.MultiPed[i].MyTask_01 == 3)
                {
                    if (MissionData.MultiPed[i].MyPed.Position.DistanceTo(MissionData.MultiPed[i].MyTarget_01) < 15.00f)
                    {
                        Vehicle MrVic = MissionData.VehicleList_01[MissionData.MultiPed[i].MyTask_02];

                        MissionData.MultiPed[i].MyPed.Task.ClearAll();
                        if (Game.Player.Character.Position.DistanceTo(MrVic.Position) < 35.00f)
                        {
                            Parra_MeliFight(MissionData.MultiPed[i].MyPed);
                            ObjectBuild.ArmsRegulator(MissionData.MultiPed[i].MyPed, 5);
                            MissionData.MultiPed[i].MySwitch_02 = false;
                        }
                        else
                        {
                            ObjectBuild.WarptoAnyVeh(MrVic, MissionData.MultiPed[i].MyPed, 1);
                            ObjectBuild.DriveToDest(MrVic, MissionData.vTarget_01, MissionData.MultiPed[i].MyPed, 35.00f, 0);
                            MissionData.MultiPed[i].MySwitch_02 = true;
                        }
                        MissionData.MultiPed[i].MyPed.IsInvincible = false;
                        MissionData.MultiPed[i].MyTask_01 = 4;
                    }
                    else
                    {
                        if (MissionData.iMissionSeq == 5)
                        {
                            if (!MissionData.MultiPed[i].MyPed.IsInVehicle())
                            {
                                if (Game.Player.Character.Position.DistanceTo(MissionData.MultiPed[i].MyPed.Position) < 20.00f)
                                {
                                    MissionData.MultiPed[i].MyPed.Task.ClearAll();
                                    MissionData.MultiPed[i].MyPed.RelationshipGroup = DataStore.GP_Mental;
                                    ObjectBuild.AttackThePlayer(MissionData.MultiPed[i].MyPed, false);
                                    ObjectBuild.ArmsRegulator(MissionData.MultiPed[i].MyPed, 5);
                                    MissionData.MultiPed[i].MySwitch_02 = false;
                                    MissionData.MultiPed[i].MyPed.IsInvincible = false;
                                    MissionData.MultiPed[i].MyTask_01 = 4;
                                }
                            }
                        }

                        if (MissionData.MultiPed[i].MySwitch_01)
                        {
                            if (MissionData.MultiPed[i].MyPed.Position.DistanceTo(MissionData.vTarget_01) > MissionData.fCorSize)
                            {
                                if (MissionData.MultiPed[i].MyTimer_01 < Game.GameTime)
                                    MissionData.MultiPed[i].MyPed.Kill();
                            }
                            else
                                MissionData.MultiPed[i].MySwitch_01 = false;
                        }
                        else
                        {
                            if (MissionData.MultiPed[i].MyPed.Position.DistanceTo(MissionData.vTarget_01) > MissionData.fCorSize)
                            {
                                MissionData.MultiPed[i].MySwitch_01 = true;
                                MissionData.MultiPed[i].MyPed.Task.ClearAll();
                                if (!MissionData.MultiPed[i].MyPed.IsInVehicle())
                                    ObjectHand.WalkThisWay(MissionData.MultiPed[i].MyPed, MissionData.vTarget_01, 1.00f);
                                MissionData.MultiPed[i].MyTimer_01 = Game.GameTime + 10000;
                            }
                        }
                    }
                }
                else if (MissionData.MultiPed[i].MyTask_01 == 4)
                {
                    if (MissionData.MultiPed[i].MySwitch_02)
                    {
                        if (MissionData.MultiPed[i].MyPed.Position.DistanceTo(MissionData.vTarget_01) < 35.00f)
                        {
                            ObjectBuild.GetOutofVeh(MissionData.MultiPed[i].MyPed, 2);
                            MissionData.MultiPed[i].MyPed.Task.ClearAll();
                            MissionData.MultiPed[i].MyPed.RelationshipGroup = DataStore.GP_Mental;
                            ObjectBuild.ArmsRegulator(MissionData.MultiPed[i].MyPed, 5);
                            ObjectBuild.FightAbility(MissionData.MultiPed[i].MyPed);
                            Function.Call(Hash.TASK_COMBAT_HATED_TARGETS_IN_AREA, MissionData.MultiPed[i].MyPed.Handle, MissionData.vTarget_01.X, MissionData.vTarget_01.Y, MissionData.vTarget_01.Z, 30.00f, 0);
                            MissionData.MultiPed[i].MySwitch_02 = false;
                        }
                    }
                    else
                    {
                        if (!MissionData.MultiPed[i].MyPed.IsInCombat)
                            Function.Call(Hash.TASK_COMBAT_HATED_TARGETS_IN_AREA, MissionData.MultiPed[i].MyPed.Handle, MissionData.vTarget_01.X, MissionData.vTarget_01.Y, MissionData.vTarget_01.Z, 30.00f, 0);
                    }

                    if (MissionData.MultiPed[i].MySwitch_01)
                    {
                        if (MissionData.MultiPed[i].MyPed.Position.DistanceTo(MissionData.vTarget_01) > MissionData.fCorSize)
                        {
                            if (MissionData.MultiPed[i].MyTimer_01 < Game.GameTime)
                                MissionData.MultiPed[i].MyPed.Kill();
                        }
                        else
                            MissionData.MultiPed[i].MySwitch_01 = false;
                    }
                    else
                    {
                        if (MissionData.MultiPed[i].MyPed.Position.DistanceTo(MissionData.vTarget_01) > MissionData.fCorSize)
                        {
                            MissionData.MultiPed[i].MySwitch_01 = true;
                            MissionData.MultiPed[i].MyPed.Task.ClearAll();
                            ObjectHand.WalkThisWay(MissionData.MultiPed[i].MyPed, MissionData.vTarget_01, 1.00f);
                            MissionData.MultiPed[i].MyTimer_01 = Game.GameTime + 10000;
                        }
                    }
                }
            }

            if (Function.Call<bool>(Hash.IS_PED_ARMED, Game.Player.Character.Handle, 6))
                MissionData.iMissionSeq = 45;

            if (MissionData.iMissionSeq == 3)
            {
                int iLast = 0;
                for (int i = 0; i < MissionData.MultiPed.Count; i++)
                {
                    if (MissionData.MultiPed[i].MyTask_01 > 0)
                        iLast += 1;
                }
                if (iLast == MissionData.MultiPed.Count)
                {
                    MissionData.VehTrackin_01.HasCollision = false;
                    Game.Player.Character.Task.ClearAnimation("amb@code_human_in_bus_passenger_idles@male@sit@base", "base");
                    Game.Player.Character.Detach();
                    Game.Player.Character.FreezePosition = false;
                    MissionData.iTime_01[0] = Game.GameTime + 5000;
                    MissionData.iMishText = 235;
                    MissionData.iMissionSeq += 1;
                }

                if (MissionData.iMissionSeq == 45)
                {
                    for (int i = 0; i < MissionData.MultiPed.Count; i++)
                        MissionData.MultiPed[i].MyPed.Detach();
                    Game.Player.Character.Detach();
                }
            }
            else
            {
                UiDisplay.ttTextBar_02.Text = "" + MissionData.MultiPed.Count + "/11";

                if (MissionData.MultiPed.Count == 0)
                    MissionData.iMissionSeq = 6;
            }
        }
