        public static void BuildMissions(int iType, string sBuildName)
        {
            LoggerLight.LogThis("TheMissions.BuildMissions, iType ==" + iType + ", sBuildName == " + sBuildName);

            if (!Directory.Exists("" + Directory.GetCurrentDirectory() + "/Scripts/NSPM/Builder/"))
                Directory.CreateDirectory("" + Directory.GetCurrentDirectory() + "/Scripts/NSPM/Builder/");

            if (iType == 1)
            {
                if (File.Exists(sBuildName))
                {
                    MissionBuilder Mb = ReadWriteXML.LoadXmMissions(sBuildName);

                    for (int i = 0; i < Mb.TruckersXM.Count; i++)
                        MissionData.MyMissions.TruckersXM.Add(Mb.TruckersXM[i]);

                    MissionData.MyMissions.ConsXM = Mb.ConsXM;
                    MissionData.MyMissions.PackersXM = Mb.PackersXM;
                    MissionData.MyMissions.FubardXM = Mb.FubardXM;
                    MissionData.MyMissions.AmbuXM = Mb.AmbuXM;
                    MissionData.MyMissions.SharksXM = Mb.SharksXM;
                    MissionData.MyMissions.JohnsXM = Mb.JohnsXM;
                    MissionData.MyMissions.RaceXM = Mb.RaceXM;
                    MissionData.MyMissions.BombXM = Mb.BombXM;
                    MissionData.MyMissions.HitXM = Mb.HitXM;
                }
                ReadWriteXML.SaveXmlMish(MissionData.MyMissions, sBuildName);
            }   //Trucking
            else if (iType == 2)
            {
                if (File.Exists(sBuildName))
                {
                    MissionBuilder Mb = ReadWriteXML.LoadXmMissions(sBuildName);

                    for (int i = 0; i < Mb.PackersXM.Count; i++)
                        MissionData.MyMissions.PackersXM.Add(Mb.PackersXM[i]);

                    MissionData.MyMissions.TruckersXM = Mb.TruckersXM;
                    MissionData.MyMissions.ConsXM = Mb.ConsXM;
