        public static void GameOver(bool bFail, string sPass, bool bAltEnd, int iCashOut)
        {
            LoggerLight.LogThis("TheMissions.GameOver, bFail == " + bFail + ", bAltEnd == " + bAltEnd + ", iCashOut == " + iCashOut);

            UiDisplay.bSubDisplay = false;
            UiDisplay.bUiDisplay = false;
            UiDisplay.bMMDisplay01 = false;
            UiDisplay.bMMDisplay02 = false;
            MissionData.bJobLoaded = false;
            SearchFor.MakeCarz.Clear();
            SearchFor.MakeFrenz.Clear();
            SearchFor.bMissingPed = false;
            MissionData.iMissionSeq = 0;
            ObjectHand.RemoveTargets();
            ObjectHand.CleanMultiPed(true, false);
            ObjectHand.CleanCams();

            ObjectHand.ClearOutAllStuff();

            ObjectHand.PostMess();

            Game.Player.WantedLevel = 0;

            if (DataStore.MySettings.EnemyStrength)
                Function.Call(Hash.SET_AI_WEAPON_DAMAGE_MODIFIER, 1.00f);

            string sEndMess = "";

            if (iCashOut != 0)
                sEndMess = "" + sPass + "" + DataStore.MyLang.Othertext[53] + "" + ReturnStuff.ShowComs(iCashOut, true, true);

            Game.FadeScreenIn(100);

            if (MissionData.bTestRun)
            {
                if (bFail)
                {
                    DataStore.iBuildingUp = 8;
                    MissionData.bTestRun = false;
                    DataStore.bBuildMode = true;
                    UiDisplay.HelperBarBuiler(11, false);
                }
                else
                {
                    MissionData.bTestRun = false;
                    DataStore.bBuildMode = true;
                    UiDisplay.HelperBarBuiler(10, false);
                }
            }
            else
                UiDisplay.BigMessLoad(bFail, sEndMess, bAltEnd, iCashOut);

            if (DataStore.bOnlineStuffLoaded && !DataStore.MySettings.PreLoadOnline)
                DataStore.LoadOnlineIps(false);

            ReadWriteXML.SaveXmlRand(DataStore.RNGod, DataStore.sNSPMRandNum);

            if (MissionData.bPlayerAtt)
            {
                MissionData.Npc_01 = null;
                while (Game.Player.Character.IsInVehicle())
                    Script.Wait(1000);
                SearchFor.SearchPed(1.00f, 75.00f, "", false, 220, 36, 0, null, 0, true, 1, 1, "");

                while (SearchFor.MakeFrenz.Count > 0)
                {
                    if (SearchFor.FindMe == null)
                    {
                        if (MissionData.iFindingTime < Game.GameTime)
                            SearchFor.FindMe = SearchFor.GetPedPos(SearchFor.MakeFrenz[0].MinRadi, SearchFor.MakeFrenz[0].MaxRadi);
                    }
                    else
                    {
                        SearchFor.PedRelpace(SearchFor.FindMe, SearchFor.MakeFrenz[0]);
                        SearchFor.MakeFrenz.RemoveAt(0);
                        SearchFor.FindMe = null;
                    }
                    Script.Wait(1);
                }
            }
        }
    }
